【商品説明】<br>口臭・歯周病を予防し、残存歯と歯ぐきを健康に保ちます。<br><br>商品サイズ：80×169×50<br><br>香り：ミント<br><br>成分：湿潤剤（濃グリセリン・ヒドロキシエチルセルロース・ヒアルロン酸Ｎａ-２） 清涼剤（エタノール） 可溶化剤（ＰＯＥ硬化ヒマシ油） 保存剤（パラベン） 有効成分（塩化セチルビリジニウム・グリチルリチン酸２Ｋ） 香味剤 香料（フレッシュミント）<br><br>ご使用上の注意等：１回（１０－１５ｍｌ）を口に含み、よくすすいでから吐き出した後、ブラッシングしてください。brブラッシングすることにより、歯グキのマッサージも行われます。br部分入れ歯・総入れ歯、どちらの方でも使えます。入れ歯をはずしてからお使いください。<br><br>本品は義歯洗浄剤でも内服液でもありません。 子供や第三者の監督が必要な方の手の届かない所に、直射日光を避けて保管してください。 発疹・発赤・かゆみ・はれ等の異常があらわれた場合には直ちに使用を中止し、医師・歯科医師または薬剤師に相談してください。 口内に異常がある時は使わないでください。 目に入った時はすぐに水で充分洗い流してください。<br><br>原産国：日本<br><br>問い合わせ先：グラクソ・スミスクライン株式会社 〒１５１－８７６６ 東京都渋谷区千駄ヶ谷４－６－１５ お客様窓口 ０１２０－４６１－８５１<br><br>区分：医薬部外品<br>JANコード：4901080717016<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
